										if(nLore.length > 0) {
											var nAmount = getCoinAmount(nLore[0].replace(/\s+/g, ''));
											if(nAmount > 0) {
												nItem.setCustomName(ccs('&2&lMoney&r'));
												nItem.setLore([ccs('&e'+getAmountCoin(nAmount))]);
											}
										}
